import './App.css';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom'
import Home from '../src/pages/Home'

function App() {



  return (
    <html lang="en">
      <body >
        <Router>
          <Switch>
            <Route path='/' exact Component={Home}>
            </Route>
          </Switch>
        </Router>

      </body>
    </html>
  );
}

export default App;
